const purpleTheme = {
	colors: {
		background: '#505050',
		opposite: '#ffffff',

		Primary: '#7C6D89',
		Secondary: '#9983AB',
		Tertiary: '#B493CE',
		Quaternary: '#D4C2E2',
		Quinary: '#F8F0FF',
	},
};

export default purpleTheme;
